import React from 'react';

// import BulletDescription from './BulletDescription';
import circle from '../images/circle.png';

const ExperienceIndi = props => {
  return (
    <div className="left-right">
      <div className="left-container">
        <h4>&nbsp;{props.months}</h4>
        <h3>{props.year}</h3>

        <img
          className="circle"
          src={circle}
          alt="timeline"
          height="20px"
          width="20px"
        />
      </div>
      <div className="right-container">
        <div className="right">
          <img
            className="logo"
            src={props.logo}
            alt={props.company + 'logo'}
            width="150px"
            height="150px"
          />
          <div className="content">
            <h2 className="title">{props.role}</h2>
            <h2 className="company"> &nbsp;@ {props.company}</h2>
            {/* <BulletDescription descriptions={props.descriptions} /> */}
          </div>
        </div>
      </div>
    </div>
  );
};

export default ExperienceIndi;
